def plot_max_sat(cnf_problem, solution, random_states):
    x = [i for i in range(2**cnf_problem.nv)]
    y = [n_satisfied_clauses(cnf_problem, i) for i in range(2**cnf_problem.nv)]
    fig = plt.figure(figsize=(20, 7))
    ax = fig.add_subplot(1, 1, 1)
    ax.plot(x, y, color='#04e5bb')
    ax.set_facecolor('#020e34')
    ax.bar([solution], [45], color='#7c40ff')
    # Set xticks at a point
    _ = ax.set_xticks([i*100 for i in range(11)])
    ax.set_ylim(25, 45)
    for state in random_states:
        ax.bar([state], [43], color='#2756ff')

