def get_solution_classically(cnf_problem):
    # Create a solver
    solver = Solver()
    # Add the problem to the solver
    solver.append_formula(cnf_problem.clauses, no_return=False)
    # Get the solution
    solver.solve()
    model = solver.get_model()
    
    # Convert the model to binary string
    binary_solution = "".join(['0' if -i in model else '1' for i in range(len(model), 0, -1)])
    
    return binary_solution


def is_satisfied(cnf_problem, int_state):
    # Convert integer state to assumptions
    state_by_assumptions = int_to_assumptions(int_state, cnf_problem.nv)
    
    # Create solver for 3-SAT
    solver = Solver()
    solver.append_formula(cnf_problem.clauses, no_return=False)
    
    # Check satisfiability with given assumptions
    return solver.solve(assumptions=state_by_assumptions)

def n_satisfied_clauses(cnf_problem, int_state):
    # Convert 3-SAT problem to Max-SAT problem
    wcnf = cnf_problem.weighted()
    
    # Convert integer state to assumptions
    state_by_assumptions = int_to_assumptions(int_state, cnf_problem.nv)
    
    # Create solver for Max-SAT
    lsu = LSU(wcnf, verbose=0)
    
    # Calculate the number of satisfied clauses
    satisfied_clauses = len(cnf_problem.clauses) - lsu._get_model_cost(wcnf, state_by_assumptions)
    
    return satisfied_clauses

def int_to_assumptions(i, n):
    # Convert integer to binary string with leading zeros and reverse it
    bin_string = format(i, '0' + str(n) + 'b')[::-1]
    
    # Generate assumptions based on binary string
    assumptions = [-(j + 1) if bit == '0' else j + 1 for j, bit in enumerate(bin_string)]
    
    return assumptions

def calculate_iterations(states, solutions=1):
    return (np.pi / (4 * np.arcsin(np.sqrt(solutions / states)))) - (1 / 2)

